import './aboutme.css';
import { Grid, Cell} from 'react-mdl';
import './aboutme.css';
import PatrikContact from '../assets/contact-patrik.png'

class About extends Component {
    render(){
        return(
            <div>
                <Grid>
                <Cell className="left-about" col={4}>
                    <div style={{textAlign: 'center'}}>
                        <img src={PatrikContact} 
                             alt="Photo of Patrik Hogler"
                             style={{height: '350px',}}
                             />

                        <h2 style={{paddingTop: '2em'}}>Patrik Hogler</h2>
                        <h4 srtyle={{color: 'grey'}}>Front End Developer</h4>
                        <hr className="project-linebreak"></hr>

                    </div>
                </Cell>

                <Cell className="right-about" col={8}>

                </Cell>
                </Grid>
            </div>
        )
    }
}

export default About;
